import "./App.css";
import React from "react";
import ChildList from "./component/ChildList";
import jsonData from "../babyNamesData.json";

function App() {
  function searchFunction(e) {
    jsonData.filter((x) => x.includes(e));
  }
  return (
    <div className="App">
      <input onChange={searchFunction}></input>
      <ChildList />
    </div>
  );
}

export default App;
